B.Kh=new A.i(3,{description:"Ramen noodles are distinct from other doughs in that the amount of water added to them (described as the \u201chydration\u201d or \u201chydration percentage\u201d), is noticeably low. In most ramen applications, hydration spans anywhere from 22% to 42% the weight of the dry flour solids. By contrast, most bread doughs start at about 60% hydration.",footer:"From The Ramen_Lord Book of Ramen, p12",imgRoute:"images/water.png"},B.cG,t.l)
B.Ki=new A.i(3,{description:"Wheat flour is the primary source of starch and protein in all ramen noodles and is a requirement for ramen  to exist. To start, keep it simple; bread flour works very well. I like to use King Arthur bread flour because the protein content is around 12.7% the weight of the flour, and the flour gives consistent results. As you get more comfortable, feel free to adjust flours.",footer:"From The Ramen_Lord Book of Ramen, p9",imgRoute:"images/flour.png"},B.cG,t.l)
B.Kf=new A.i(3,{description:"Kansui is a catchall term for the alkaline salts used to increase the pH of the water and impact the gluten and structure of the noodle. Several different salts can be considered kansui. In American kitchens, the most common salts are sodium carbonate and potassium carbonate. \nSodium carbonate will produce a softer, chewier noodle while potassium carbonate will produce a snappier more brittle noodle. You can always blend the two types of kansui together to make a ratio that produces the kind of effects that you want.",footer:"From The Ramen_Lord Book of Ramen, p11 & Way of Ramen's 'The Science Behind a Perfect Ramen Noodle'",imgRoute:"images/kansui.png"},B.cG,t.l)
B.Kk=new A.i(3,{description:"Salt performs a similar, but different, function to alkaline salts on the structure of the dough. Sodium ions from the salt help the gluten retain rigidity, prevent overhydration, and increase your ability to mix the dough without over-developing gluten. Sodium carbonate would also contribute to this by providing sodium, but it being alkaline salt it serves a different chemical function. Salt also adds flavor to the dough.",footer:"From The Ramen_Lord Book of Ramen, p14",imgRoute:"images/salt.png"},B.cG,t.l)
B.Kg=new A.i(3,{description:"The protein content is primarily derived from wheat gluten and contributes to the noodle's consistency. The higher the protein content, the more chewiness and \"snap\".\nThe protein amount is calculated over the dough's solids, i.e. flour and adjuncts.",footer:"Chart information from yamatonoodle.com",imgRoute:"images/protein.png"},B.cG,t.l)
B.Kj=new A.i(3,{description:"An adjunct is anything you can add to your dough to enhance the characteristics of the core ingredients.",footer:"From Way of Ramen's 'The Science Behind a Perfect Ramen Noodle",imgRoute:"images/adjuncts.png"},B.cG,t.l)
